import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Click the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_button_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_button_clicked.png'));

    // Wait for the cart element and take a screenshot
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_visible.png'));

    // Click on the checkout button
    await page.waitForSelector('.checkout-btn', { timeout: 5000 });
    await page.click('.checkout-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_checkout_button_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_checkout_button_clicked.png'));

    return {
      success: true,
      action: "Performed rapid cart manipulation stress test",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
